class Solution(object):
    def makeTheIntegerZero(self, num1, num2):
        """
        :type num1: int
        :type num2: int
        :rtype: int
        """
        if num2 == 0:
            return -1

        operations = 0
        while num1 != 0:
            for i in range(60, -1, -1):
                operation_value = 2**i + num2
                if abs(operation_value) <= abs(num1) and (num1 > 0) == (operation_value > 0):
                    num1 -= operation_value
                    operations += 1
                    break
            else:  # If no operation_value found that can reduce num1 towards 0
                return -1

        return operations
